import React from 'react';
import { Draggable } from '@hello-pangea/dnd';
import {
  Trash2,
  Copy,
  GripVertical,
  Type,
  Mail,
  List,
  CheckSquare,
  Settings,
  AlertCircle
} from 'lucide-react';

const fieldIcons = {
  text: Type,
  email: Mail,
  select: List,
  checkbox: CheckSquare,
};

const FieldPreview = ({ field, index, isSelected, onRemove, onDuplicate }) => {
  const Icon = fieldIcons[field.type] || Settings;

  return (
    <Draggable draggableId={field.id} index={index}>
      {(provided, snapshot) => (
        <div
          ref={provided.innerRef}
          {...provided.draggableProps}
          className={`card-hover p-4 transition-all ${
            isSelected ? 'ring-2 ring-primary-500 bg-primary-50/50' : ''
          } ${snapshot.isDragging ? 'shadow-lg' : ''}`}
        >
          <div className="flex items-start space-x-3">
            {/* Drag Handle */}
            <div
              {...provided.dragHandleProps}
              className="flex-shrink-0 cursor-grab active:cursor-grabbing mt-1"
            >
              <GripVertical className="w-5 h-5 text-secondary-400" />
            </div>

            {/* Field Icon */}
            <div className={`flex-shrink-0 w-10 h-10 rounded-lg flex items-center justify-center ${
              field.type === 'checkbox' ? 'bg-green-100' : 'bg-primary-100'
            }`}>
              <Icon className={`w-5 h-5 ${
                field.type === 'checkbox' ? 'text-green-600' : 'text-primary-600'
              }`} />
            </div>

            {/* Field Info */}
            <div className="flex-1 min-w-0">
              <div className="flex items-center space-x-2 mb-1">
                <h3 className="font-medium text-secondary-900 truncate">
                  {field.label}
                </h3>
                {field.required && (
                  <span className="text-red-500">*</span>
                )}
              </div>

              <div className="flex items-center space-x-2 text-sm text-secondary-500">
                <span className="badge-secondary capitalize">{field.type}</span>
                <span className="text-xs font-mono text-secondary-400">
                  {field.name}
                </span>
              </div>

              {/* Preview of the field */}
              <div className="mt-3">
                {field.type === 'text' || field.type === 'email' ? (
                  <div className="w-full px-3 py-2 border border-secondary-300 rounded-lg bg-secondary-50 text-secondary-400 text-sm">
                    {field.placeholder || `Enter ${field.label.toLowerCase()}...`}
                  </div>
                ) : field.type === 'select' ? (
                  <div className="custom-select bg-secondary-50 text-secondary-400 cursor-not-allowed">
                    {field.placeholder || 'Select an option...'}
                  </div>
                ) : field.type === 'checkbox' ? (
                  <div className="flex items-center space-x-2">
                    <div className="w-5 h-5 border-2 border-secondary-300 rounded bg-secondary-50" />
                    <span className="text-sm text-secondary-500">{field.helpText || 'Checkbox option'}</span>
                  </div>
                ) : null}
              </div>

              {/* Help Text */}
              {field.helpText && (
                <p className="mt-2 text-xs text-secondary-500 flex items-center">
                  <AlertCircle className="w-3 h-3 mr-1" />
                  {field.helpText}
                </p>
              )}
            </div>

            {/* Actions */}
            <div className="flex-shrink-0 flex items-center space-x-1">
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  onDuplicate();
                }}
                className="btn-icon"
                title="Duplicate field"
              >
                <Copy className="w-4 h-4" />
              </button>
              <button
                onClick={(e) => {
                  e.stopPropagation();
                  onRemove();
                }}
                className="btn-icon text-red-500 hover:bg-red-50"
                title="Remove field"
              >
                <Trash2 className="w-4 h-4" />
              </button>
            </div>
          </div>
        </div>
      )}
    </Draggable>
  );
};

export default FieldPreview;
